import React from 'react';
import { View, StyleSheet, Image } from 'react-native'


const Home = () => {


  return (
    <View>
        <Image style={{width: 150, height: 300}} source={require('../assets/logo (2).png')}/>
    </View>
  );
};
export default Home;
